import { FormControl, FormHelperText, Input, InputLabel, Button, Menu, MenuItem, Divider } from '@mui/material';
import Card from '@mui/material/Card';
import React, { useState, useEffect } from 'react';
import { useForm, SubmitHandler } from 'react-hook-form';
import { EventEmitter } from 'stream';

type Inputs = {
  email: string;
  firstName: string;
  lastName: string;
  gender: string;
  status: string;
};

const genderOptions = ['Male', 'Female'];
const statusOptions = ['Active', 'Inactive'];

const CreateUserCard: any = () => {
  const [anchorElGender, setAnchorElGender] = useState(null);
  const [anchorElStatus, setAnchorElStatus] = useState(null);
  const openGender = Boolean(anchorElGender);
  const openStatus = Boolean(anchorElStatus);

  const handleGenderClick = (event: any): any => {
    console.log('handleClickEvent', event);
    setAnchorElGender(event.currentTarget);
  };
  const handleStatusClick = (event: any): any => {
    console.log('handleClickEvent', event);
    setAnchorElStatus(event.currentTarget);
  };
  const [gender, setGender] = useState('');
  const [status, setStatus] = useState('');

  const {
    register,
    handleSubmit,
    watch,
    formState: { errors }
  } = useForm<Inputs>();

  const onSubmit = (e: any) => {
    console.log(e);
    fetch('https://gorest.co.in/public/v2/users', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
        Authorization: 'Bearer 35fbde49d5eb4a5a443446e7ba864d71ed3969a1ee48247811f6733ebe664c93'
      },
      body: JSON.stringify({
        name: `${e.firstName} ${e.lastName}`,
        email: e.email,
        gender: gender,
        status: e.status
      })
    })
      .then((res) => res.json())
      .then((result) => console.log(result))
      .catch((err) => console.log('error'));
  };

  const handleGender = (gender: any): any => {
    setAnchorElGender(null);
    setGender(gender);
  };

  const handleStatus = (status: any): any => {
    setAnchorElStatus(null);
    setStatus(status);
  };

  const handleStatusClose = () => {
    setAnchorElStatus(null);
  };

  const handleGenderClose = () => {
    setAnchorElGender(null);
  };

  return (
    <div>
      <Card sx={{ maxWidth: 345 }}>
        <form onSubmit={handleSubmit(onSubmit)}>
          <FormControl>
            <InputLabel htmlFor="email">Email address</InputLabel>
            <Input id="email" placeholder="Enter Email" aria-describedby="my-helper-text" {...register('email', { required: true, pattern: /^[\w-\.]+@([\w-]+\.)+[\w-]{2,4}$/ })} />
            <FormHelperText id="my-helper-text">Non-sensitive Information Please</FormHelperText>
          </FormControl>
          <FormControl>
            <InputLabel htmlFor="first-name">First Name</InputLabel>
            <Input id="first-name" placeholder="Enter First Name" {...register('firstName', { required: true, max: 16, min: 2 })} />
          </FormControl>
          <FormControl>
            <InputLabel htmlFor="last-name">last Name</InputLabel>
            <Input id="last-name" placeholder="Enter Last Name" {...register('lastName', { required: true, max: 16, min: 2 })} />
          </FormControl>
          <FormControl>
            <InputLabel htmlFor="gender-button">Gender</InputLabel>
            <Input
              id="gender-button"
              aria-controls={openGender ? 'gender' : undefined}
              aria-haspopup="true"
              aria-expanded={openGender ? 'true' : undefined}
              value={gender}
              onClick={handleGenderClick}
            />

            <Menu id="gender" MenuListProps={{ 'aria-labelledby': 'gender-button' }} anchorEl={anchorElGender} open={openGender} onClose={handleClose}>
              {genderOptions.map((gender: string) => {
                return (
                  <span key={`gender-${gender}`}>
                    <MenuItem onClick={() => handleGender(gender)}>{gender}</MenuItem>
                    <Divider />
                  </span>
                );
              })}
            </Menu>
          </FormControl>
          <FormControl>
            <InputLabel htmlFor="status-button">Status</InputLabel>
            <Input
              id="status-button"
              aria-controls={openStatus ? 'status' : undefined}
              aria-haspopup="true"
              aria-expanded={openStatus ? 'true' : undefined}
              value={status}
              onClick={handleStatusClick}
            />

            <Menu id="status" MenuListProps={{ 'aria-labelledby': 'status-button' }} anchorEl={anchorElStatus} open={openStatus} onClose={handleClose}>
              {statusOptions.map((status: string) => {
                return (
                  <span key={`status-${status}`}>
                    <MenuItem onClick={() => handleStatus(status)}>{status}</MenuItem>
                    <Divider />
                  </span>
                );
              })}
            </Menu>
          </FormControl>
          {/* <FormControl>
            <InputLabel htmlFor="last-name">Status</InputLabel>
            <Input id="last-name" placeholder="Enter Status" {...register('status', { required: true })} />
          </FormControl> */}
          <FormControl>
            <Button type="submit">Create User</Button>
          </FormControl>
        </form>
      </Card>
      {/* Create User
      <div>
        <form onSubmit={handleSubmit(onSubmit)}>
          <input type="email" {...register('email', { required: true, pattern: /^[\w-\.]+@([\w-]+\.)+[\w-]{2,4}$/ })} />
          {errors.email && 'Email is Required'}
          <input {...register('firstName', { required: true })} />
          {errors.firstName && 'First name is Required'}
          <input {...register('lastName', { required: true })} />
          {errors.lastName && 'Last name is Required'}
          <input {...register('gender', { required: true })} />
          {errors.gender && 'Gender is Required'}
          <input {...register('status', { required: true })} />
          {errors.status && 'Status is Required'}
          <button type="submit"> Create </button>
        </form>
      </div> */}
    </div>
  );
};

export default CreateUserCard;
